/**
 * timeline
 * 时间轴
 * 插入 animate 进行动画
 */
import { IProps, ICallBackChange, ITimelineCallBack, ITimeLineMode } from '../typings';
import Element from './animateElement';
import Timeline from './timeline';
export default class AnimateGroup {
    props: IProps;
    id?: string;
    children: Element[];
    totalTime: number;
    totalTimeRegion: number;
    childTotalTime: number;
    childRegionTotalTime: number;
    prevMoment?: number;
    progressTime: number;
    progressMoment: number;
    startMoment: number;
    startTime: number;
    repeatNum: number;
    mode: ITimeLineMode;
    pausedState?: boolean;
    reverseState?: boolean;
    root: any;
    parent?: Timeline;
    regionStartTime: number;
    regionEndTime?: number;
    onChangeChild: (e: ICallBackChange) => void;
    onChangeTimeline: (e: ITimelineCallBack) => void;
    constructor(props: IProps);
    init: () => void;
    addChild: (animate: Element) => void;
    setTotalTime: () => void;
    setStartTimeOrMoment: (start?: number | undefined) => void;
    reRenderCall: () => void;
    play: (v?: boolean | undefined) => void;
    paused: (v?: boolean) => void;
    reverse: (v?: boolean | undefined) => void;
    goto: ($moment: number, paused?: boolean | undefined) => void;
    kill: (index?: number | undefined) => void;
    onChange: (e: ICallBackChange) => void;
    render: ({ time, elapsed }: {
        time: number;
        elapsed?: number | undefined;
    }) => void;
}
